import React from 'react';
import style from '../ServicesStyle.module.css';

function ServicesType() {
    return(
        <div className={style.services__types}>
            <div className={style.services__type}>
                <img src="agency/src/img/Diamond.png" alt=""/>
                <h1>Hello</h1>
            </div>
        </div>
    );
}

export default ServicesType;
